import classes from "./UserEdit.module.css";
function UserEdit(props) {
  return (
    <>
      <div className={classes.wrapper}>
        {props.children}
        <h1 className={classes.mainTitle}>User info</h1>
        <h2 className={classes.subTitle}>Name</h2>
        <input className={classes.info} placeholder={props.user.name} />
        <h2 className={classes.subTitle}>Email</h2>
        <input className={classes.info} type={"email"} placeholder={props.user.email} />
        <h2 className={classes.subTitle}>Date</h2>
        <input className={classes.info} type={"date"} placeholder={props.user.birthdate} />
        <h2 className={classes.subTitle}>Department</h2>
        <input className={classes.info} placeholder={props.user.department} />
      </div>
      <div className={classes.overlay}></div>
    </>
  );
}
export default UserEdit;
